import styled from 'styled-components';
export const HeaderWrapper = styled.div`
    height: 70px;
    width: 100%;
    border-bottom: 3px solid #7c9c99;
    display: flex;
    overflow: hidden;
    min-width: 1200px;
    background-color:#7c9c99;

`;
export const Logo=styled.div`
    margin-top:10px;
    margin-left:5%;
`;

export const HeaderList=styled.div`
    height: 70px;
    width: 100%;
    pedding-righ: 70px;
    box-sizing: border-box;
    margin: 0,auto;

`;
export const LogoText=styled.p`
    font-size:24px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
    width: 120px;
    margin-top: 40px;
    margin-left: 3px;
    float: left;
`;
export const PeoLogo2=styled.button`
    float: right;
    width: 100px;
    font-family: 'Noto Sans TC', sans-serif;
    font-size:15px;
    color:white;
    display: flex;
    margin-right:20px;
    align-items: center;
    background-color:transparent;
    border: 0;
    &.hover{
        background-color: rgba(136, 236, 178, 0.803);
    }
`;

export const PeoLogo=styled.button`
    float: right;
    height: 50px;
    width: 52px;
    background-color:white;
    margin:10px;
    margin-right:5%;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius:50px;
`;
